Get data from @ManyToOne() relation mikro orm mongodb<p>I have a Post entity:</p>
<pre><code>export class Post {
  @PrimaryKey()
  _id!: ObjectId;

  @Field(() =&gt; ID)
  @SerializedPrimaryKey()
  id!: string;

  @Field(() =&gt; String)
  @Property()
  createdAt: Date = new Date();

  @Field(() =&gt; String)
  @Property({ onUpdate: () =&gt; new Date() })
  updatedAt: Date = new Date();

  @Field(() =&gt; String)
  @Property()
  title!: string;

  @Field(() =&gt; String)
  @Property()
  excerpt!: string;

  @Field(() =&gt; String)
  @Property()
  content!: string;

  @Field(() =&gt; User)
  @ManyToOne()
  author!: User;
}
</code></pre>
<p>User Entity:</p>
<pre><code>@ObjectType()
@Entity()
export class User {
  @PrimaryKey()
  _id!: ObjectId;

  @Field(() =&gt; ID)
  @SerializedPrimaryKey()
  id!: string;

  @Field(() =&gt; String)
  @Property()
  createdAt = new Date();

  @Field(() =&gt; String)
  @Property({ onUpdate: () =&gt; new Date() })
  updatedAt = new Date();

  @Field(() =&gt; String)
  @Property()
  name!: string;

  @Field(() =&gt; String)
  @Property({ unique: true })
  email!: string;

  @Property()
  password!: string;

  @Field(() =&gt; [Post], { nullable: true })
  @OneToMany(() =&gt; Post, (post) =&gt; post.author)
  posts = new Collection&lt;Post&gt;(this);
}
</code></pre>
<p>Create Post function:</p>
<pre><code> @Mutation(() =&gt; Post)
  async createPost(
    @Arg(&quot;post&quot;) post: PostInput,
    @Ctx() { em, req }: appContext
  ) {
    const newPost = em.create(Post, {
      ...post,
      author: new ObjectId(req.session.sid),
    });
    await em.persistAndFlush(newPost);
    return newPost;
  }
</code></pre>
<p>As you can see, User and Post are related with one to many relations respectively. <code>user.posts</code> is working correctly, as we need to add <code>init()</code>. But when I tried to log <code>post.author</code> it is giving me the following:</p>
<pre><code>Ref&lt;User&gt; { _id: ObjectId('600663ef9ee88b1b9c63b275') }
</code></pre>
<p>I have searched the docs but couldn't find how to populate the author field.</p>

