                $first: '$topLevelFilter.name'
            },
            type: {
                $first: '$topLevelFilter.type'
            },
            fail: {
                $sum: {
                    $cond: [{
                        $eq: ['$summaryStatus', 0]
                    }, 1, 0]
                }
            },
            pass: {
                $sum: {
                    $cond: [{
                        $eq: ['$summaryStatus', 1]
                    }, 1, 0]
                }
            },
            warn: {
                $sum: {
                    $cond: [{
                        $eq: ['$summaryStatus', 2]
                    }, 1, 0]
                }
            }
        }
    },
    {
        $group: {
            _id: '$_id.ruleCategory',
            fail: {
                $sum: '$fail'
            },
            pass: {
                $sum: '$pass'
            },
            warn: {
                $sum: '$warn'
            },
            portfolio: {
                $push: {
                    id: '$_id.topLevelFilter',
                    name: '$name',
                    type: '$type',
                    fail: '$fail',
                    pass: '$pass',
                    warn: '$warn'
                }
            }
        }
    },
    {
        $group: {
            _id: 0,
