<p>If I am going to send aggregation query from UI as a JSON string, then there are some concern from team related to security i.e, db injection kind of things. If i am going to send some json structure to my lambda function to create query, then i think i am going to implement one level of extra translation layer, that I want to avoid.</p>
<p>So what will be the best approach to avoid injection stuff and achieve a good performance.</p>
</li>
</ol>
<ol start="2">
<li>One more thing I am new to mongoDB, so if anyone can help me to optimise the query would be also a great help.</li>
